import React from "react";
import { Box, Container, Typography, Button, TextField } from "@mui/material";

const Signup = () => {
  return (
    <Container>
      <Box display="flex" justifyContent="center">
        <Typography variant="h2" style={{ margin: "10px" }}>
          {" "}
          Sign Up{" "}
        </Typography>
      </Box>
    </Container>
  );
};

export default Signup;
